I've explained it to you in the DM, but I will do a short version here;
Sometimes miners get timeout issues, due to the big amount of miners (125) that get a request at the same time, leading to unfair differences in when a miner receives the request (e.g. some miners get the request after multiple seconds...). This leads to timeouts (often for the same miners due to them being in the same location/ip), giving them alot of 0 scores and dropping in incentive.

Our update fixes this by only sending it out to a limited amount of miners concurrently, this should solve that issue and should stop the sudden drops.

